import React, { useState } from "react";
type AreaSelectorProps = {
  area: "abdomen"; // Add all possible values for 'area'
};
const AreaSelector = ({ area }: AreaSelectorProps) => {
  interface AbdomenState {
    umbilicus: boolean;
    suprapubic: boolean;
    ruq: boolean;
    rlq: boolean;
    luq: boolean;
    llq: boolean;
  }
  const [selectedAbdomen, setSelectedAbdomen] = useState<AbdomenState>({
    umbilicus: false,
    suprapubic: false,
    ruq: false,
    rlq: false,
    luq: false,
    llq: false,
  });

  const toggleArea = (area: keyof AbdomenState) => {
    setSelectedAbdomen((prevState) => ({
      ...prevState,
      [area]: !prevState[area], // Toggle the selected area
    }));
  };
  const baseImage = `/images/default-${area}.png`;
  const highlightImages = {
    abdomen: {
      umbilicus: "/images/umbilicus-highlight.png",
      suprapubic: "/images/suprapubic-highlight.png",
      ruq: "/images/ruq-highlight.png",
      rlq: "/images/rlq-highlight.png",
      luq: "/images/luq-highlight.png",
      llq: "/images/llq-highlight.png",
    },
    finger: {},
  };
  const labels = {
    abdomen: {
      umbilicus: "/images/umbilicus-active.png",
      suprapubic: "/images/suprapubic-active.png",
      ruq: "/images/ruq-active.png",
      rlq: "/images/rlq-active.png",
      luq: "/images/luq-active.png",
      llq: "/images/llq-active.png",
    },
    finger: {},
  };
  return (
    <div className="relative">
      <img
        className="justify-center items-center"
        src={baseImage}
        alt="default-abs"
      />
      {selectedAbdomen.umbilicus && (
        <div>
          <img
            src={highlightImages[area].umbilicus}
            alt="Umbilicus highlighted"
            className="absolute"
            style={{
              top: "0",
              left: "0",
            }}
          />
          <img
            src={labels[area].umbilicus}
            alt="Umbilicus label"
            className="absolute"
            style={{
              top: "0",
              left: "0",
            }}
          />
        </div>
      )}
      {selectedAbdomen.suprapubic && (
        <div>
          <img
            src={highlightImages[area].suprapubic}
            alt="suprapubic highlighted"
            className="absolute"
            style={{
              top: "0",
              left: "0",
            }}
          />
          <img
            src={labels[area].suprapubic}
            alt="suprapubic label"
            className="absolute"
            style={{
              top: "0",
              left: "0",
            }}
          />
        </div>
      )}
      {selectedAbdomen.ruq && (
        <div>
          <img
            src={highlightImages[area].ruq}
            alt="ruq highlighted"
            className="absolute"
            style={{
              top: "0",
              left: "0",
            }}
          />
          <img
            src={labels[area].ruq}
            alt="ruq label"
            className="absolute"
            style={{
              top: "0",
              left: "0",
            }}
          />
        </div>
      )}
      {selectedAbdomen.rlq && (
        <div>
          <img
            src={highlightImages[area].rlq}
            alt="rlq highlighted"
            className="absolute"
            style={{
              top: "0",
              left: "0",
            }}
          />
          <img
            src={labels[area].rlq}
            alt="rlq label"
            className="absolute"
            style={{
              top: "0",
              left: "0",
            }}
          />
        </div>
      )}
      {selectedAbdomen.luq && (
        <div>
          <img
            src={highlightImages[area].luq}
            alt="luq highlighted"
            className="absolute"
            style={{
              top: "0",
              left: "0",
            }}
          />
          <img
            src={labels[area].luq}
            alt="luq label"
            className="absolute"
            style={{
              top: "0",
              left: "0",
            }}
          />
        </div>
      )}
      {selectedAbdomen.llq && (
        <div>
          <img
            src={highlightImages[area].llq}
            alt="llq highlighted"
            className="absolute"
            style={{
              top: "0",
              left: "0",
            }}
          />
          <img
            src={labels[area].llq}
            alt="llq label"
            className="absolute"
            style={{
              top: "0",
              left: "0",
            }}
          />
        </div>
      )}
      <div
        className="absolute top-[49%]	left-[43.5%] w-20 h-20 cursor-pointer rounded-full"
        onClick={() => toggleArea("umbilicus")}
        style={{ border: "1px solid red", opacity: 1 }}
      ></div>
      <div
        className="absolute top-[59%]	left-[42.5%] w-24 h-24 cursor-pointer rounded-full"
        onClick={() => toggleArea("suprapubic")}
        style={{ border: "1px solid red", opacity: 1 }}
      ></div>
      <div
        className="absolute top-[42.5%]	left-[33%] w-24 h-24 cursor-pointer rounded-full"
        onClick={() => toggleArea("ruq")}
        style={{ border: "1px solid red", opacity: 1 }}
      ></div>
      <div
        className="absolute top-[53.5%]	left-[32%] w-24 h-24 cursor-pointer rounded-full"
        onClick={() => toggleArea("rlq")}
        style={{ border: "1px solid red", opacity: 1 }}
      ></div>
      <div
        className="absolute top-[42.5%]	left-[52%] w-24 h-24 cursor-pointer rounded-full"
        onClick={() => toggleArea("luq")}
        style={{ border: "1px solid red", opacity: 1 }}
      ></div>
      <div
        className="absolute top-[53.5%]	left-[52.5%] w-24 h-24 cursor-pointer rounded-full"
        onClick={() => toggleArea("llq")}
        style={{ border: "1px solid red", opacity: 1 }}
      ></div>
    </div>
  );
};
export default AreaSelector;
